import React from "react";
import {Button, Card, CardBody, CardTitle, CardImg, CardText} from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

export const PlaceComponent = function({photo, name, raiting, description, location}){
    return(
        <>
        <CardColumns
  style={{
    width: '18rem'
  }}>
  <Card className="my-2">
    <CardImg src = {photo}/>
    <CardBody>
      <CardTitle tag="h5">
        {name}
      </CardTitle>
      <CardText>
        {description}
      </CardText>
      <CardText>
        <small className="text-muted">
          {location}
        </small>
      </CardText>
      <CardText>
        <small className="text-muted">
          Raiting: {raiting}
        </small>
      </CardText>
    </CardBody>
  </Card>
  </CardColumns>
</>

    );
}
